import React from 'react'

function Articles(posts) {
    return (
        <div>
            welcome to Articles

            {
                posts.map((article,key)=>(
<div>
                    <h2>{article.title}</h2>
                   <p>{article.article}</p>
                   <span>{article.authername}</span>
                </div>

                ))}
        </div>
    )
}

export default Articles
